import React,{ forwardRef } from 'react';
import classes from './Home.module.css';


const DetailsModal = forwardRef((props, ref) => {
  return (
    <dialog ref={ref} className={classes["info-modal"]}>
        <h2>You Lost!</h2>
        <p>Hello World!</p>
        <form method="dialog">
            <button>Close</button>
        </form>
    </dialog>
  );
});

export default DetailsModal;
